/*
Other ui styels less template from the web
// This file has fallback variables. It specifies the variables themes
// must implement.

// Colors

@text-color: #333;
@text-color-subtle: #777;
@text-color-highlight: #111;
@text-color-selected: @text-color-highlight;

@text-color-info: #5293d8;
@text-color-success: #1fe977;
@text-color-warning: #f78a46;
@text-color-error: #c00;

@background-color-info: #0098ff;
@background-color-success: #17ca65;
@background-color-warning: #ff4800;
@background-color-error: #c00;
@background-color-highlight: hsla(0,0%,0%,.1);
@background-color-selected: @background-color-highlight;

@app-background-color: #fff;

@base-background-color: #fff;
@base-border-color: #eee;

@pane-item-background-color: @base-background-color;
@pane-item-border-color: @base-border-color;

@input-background-color: #fff;
@input-border-color: @base-border-color;

@tool-panel-background-color: #f4f4f4;
@tool-panel-border-color: @base-border-color;

@inset-panel-background-color: #eee;
@inset-panel-border-color: @base-border-color;

@panel-heading-background-color: #ddd;
@panel-heading-border-color: transparent;

@overlay-background-color: #f4f4f4;
@overlay-border-color: @base-border-color;

@button-background-color: #ccc;
@button-background-color-hover: lighten(@button-background-color, 5%);
@button-background-color-selected: @button-background-color-hover;
@button-border-color: #aaa;

@tab-bar-background-color: #fff;
@tab-bar-border-color: darken(@tab-background-color-active, 10%);
@tab-background-color: #f4f4f4;
@tab-background-color-active: #fff;
@tab-border-color: @base-border-color;

@tree-view-background-color: @tool-panel-background-color;
@tree-view-border-color: @tool-panel-border-color;

@ui-site-color-1: @background-color-success; // green
@ui-site-color-2: @background-color-info; // blue
@ui-site-color-3: @background-color-warning; // orange
@ui-site-color-4: #db2ff4; // purple
@ui-site-color-5: #f5e11d; // yellow


// Sizes

@font-size: 13px;
@input-font-size: 14px;

@disclosure-arrow-size: 12px;

@component-padding: 10px;
@component-icon-padding: 5px;
@component-icon-size: 16px;
@component-line-height: 25px;
@component-border-radius: 2px;

@tab-height: 30px;

// Other

@font-family: system-ui;
@use-custom-controls: true; // false uses native controls
*/
atom-overlay.autocomplete-plus {
  z-index: 12;
}
autocomplete-suggestion-list.select-list.popover-list {
  width: auto !important;
  display: inline-block;
  min-width: 243px;
  padding: 0;
  overflow: hidden;
  color: #a8a8a8;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-list-scroller {
  overflow-y: auto;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-description {
  padding: 5px 0;
  padding-left: 0.6em;
  padding-right: 0.6em;
  min-height: 2em;
  line-height: 1.3;
  background: #261d32;
  border-radius: 0 0 2px 2px;
  width: min-content;
  min-width: 100%;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-description-content {
  font-size: 13px;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  max-height: 33vh;
  display: block;
  overflow-y: auto;
  white-space: pre-wrap;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-description-more-link {
  font-size: 13px;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  color: #6494ed;
}
autocomplete-suggestion-list.select-list.popover-list input {
  position: absolute;
  opacity: 0.00;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group {
  margin-top: 0;
  display: table;
  width: 100%;
  margin-right: 10px;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li {
  display: table-row;
  color: #a8a8a8;
  line-height: 2em;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li > span {
  display: table-cell;
  vertical-align: middle;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li:after {
  clear: both;
  display: block;
  content: ' ';
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .word {
  color: rgba(255, 255, 255, 0.8);
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .character-match {
  color: #ffffff;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .left-label,
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .right-label,
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .snippet-completion {
  color: rgba(255, 255, 255, 0.5);
}
autocomplete-suggestion-list .icon-container {
  width: 2em;
  padding-left: 0;
  padding-right: 0.75em;
}
autocomplete-suggestion-list .icon-container:empty {
  width: 0.6em;
  padding: 0;
}
autocomplete-suggestion-list .icon {
  display: block;
  width: 2em;
  line-height: 2em;
  text-align: center;
  font-style: normal;
  font-weight: bold;
  color: #808080;
  background: rgba(168, 168, 168, 0.1);
}
autocomplete-suggestion-list .icon:empty {
  display: none;
}
autocomplete-suggestion-list .icon > *::before {
  font-size: 1em;
  width: 1em;
  height: 1em;
}
autocomplete-suggestion-list .icon .icon-letter {
  position: relative;
  top: -0.1em;
  font-size: 0.9em;
  line-height: 0.9em;
}
autocomplete-suggestion-list .left-label {
  text-align: right;
  padding-right: 0.75em;
  vertical-align: middle;
  font-size: 0.9em;
  color: #808080;
}
autocomplete-suggestion-list .left-label:empty {
  padding-right: 0;
}
autocomplete-suggestion-list .right-label {
  padding-right: 0.75em;
  font-size: 0.9em;
  color: #808080;
}
autocomplete-suggestion-list .right-label:empty {
  padding-right: 0;
}
autocomplete-suggestion-list .word-container {
  padding-right: 0.75em;
}
autocomplete-suggestion-list .word {
  float: left;
}
autocomplete-suggestion-list .character-match {
  font-weight: bold;
  color: #f0f0f0;
}
autocomplete-suggestion-list .snippet-completion {
  color: #808080;
}
autocomplete-suggestion-list .left-label {
  max-width: 20vw;
}
autocomplete-suggestion-list .word {
  max-width: 35vw;
}
autocomplete-suggestion-list .right-label {
  max-width: 25vw;
}
autocomplete-suggestion-list .word,
autocomplete-suggestion-list .left-label,
autocomplete-suggestion-list .right-label {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
